script: |
  super -f text -I q11728.spq | sort > q11728.out

inputs:
  - name: q11728.spq
    data: |
      SELECT DISTINCT col2 * + col0 + + col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - col2 BETWEEN + col0 * - col2 - + col2 * col2 * col2 AND ( tab2.col2 - + col2 );
  - name: tab2

outputs:
  - name: q11728.out
    data: |
